const Book = ({ title, author, publishingHouse, pages }) => {
  return (
    <>
      <li>
        <span>title:</span> {title}
      </li>
      <li>
        <span>author:</span> {author}
      </li>
      <li>
        <span>publishing House:</span> {publishingHouse}
      </li>
      <li>
        <span>pages:</span> {pages}
      </li>
    </>
  );
};

export default Book;
